import React, { Component } from 'react';

export default class TaskList extends Component {
    render() {
        let checklist = this.props.tasks.map((task, id) => {
            return 
                <li key={task.id}>
                    {task.taskTitle}
                </li>
        })
       return(
           <div className="TaskList">
                <ul>{checklist}</ul>
            </div>
        )
    }
}
